import React, { useState } from "react";
import axios from "axios";
import "./AddNewUser.css"; // Import CSS for AddNewUser page

const AddNewUser = () => {
  const [associateName, setAssociateName] = useState("");
  const [associateId, setAssociateId] = useState("");
  const [localSystemId, setLocalSystemId] = useState("");
  const [email, setEmail] = useState("");
  const [managerId, setManagerId] = useState("");
  const [managerEmail, setManagerEmail] = useState("");
  const [managerName, setManagerName] = useState("");
  const [directReport, setDirectReport] = useState("");
  const [company, setCompany] = useState("");
  const [opco, setOpco] = useState("");

  const handleSubmit = (event) => {
    event.preventDefault();
    const userData = {
      associateName,
      associateId,
      localSystemId,
      email,
      managerId,
      managerEmail,
      managerName,
      directReport,
      company,
      opco,
    };
    // POST request to save user data
    axios
      .post("http://localhost:3000/admin/add-user", userData)
      .then((response) => {
        console.log("User data saved successfully:", response.data);
        // Clear input fields after successful submission
        setAssociateName("");
        setAssociateId("");
        setLocalSystemId("");
        setEmail("");
        setManagerId("");
        setManagerEmail("");
        setManagerName("");
        setDirectReport("");
        setCompany("");
        setOpco("");
      })
      .catch((error) => {
        console.error("Error saving user data:", error);
      });
  };

  return (
    <div className="add-user-page">
      <h2 className="add-user-header">Add New User</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <input
            type="text"
            placeholder="Associate Name"
            value={associateName}
            onChange={(e) => setAssociateName(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="text"
            placeholder="Associate ID"
            value={associateId}
            onChange={(e) => setAssociateId(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="text"
            placeholder="Local System ID"
            value={localSystemId}
            onChange={(e) => setLocalSystemId(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="text"
            placeholder="Manager ID"
            value={managerId}
            onChange={(e) => setManagerId(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="email"
            placeholder="Manager Email"
            value={managerEmail}
            onChange={(e) => setManagerEmail(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="text"
            placeholder="Manager Name"
            value={managerName}
            onChange={(e) => setManagerName(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="text"
            placeholder="Direct Report"
            value={directReport}
            onChange={(e) => setDirectReport(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="text"
            placeholder="Company"
            value={company}
            onChange={(e) => setCompany(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="text"
            placeholder="Opco"
            value={opco}
            onChange={(e) => setOpco(e.target.value)}
            required
          />
        </div>
        <button type="submit" className="submit-button">
          Add User
        </button>
      </form>
    </div>
  );
};

export default AddNewUser;
